import React from "react";
import "./NewExpenseItem.css";
import ExpenseItem from "./ExpenseItem";

function NewExpensesItem() {
  return (
    <div className="expenses">
      <ExpenseItem />
      <ExpenseItem />
      <ExpenseItem />
    </div>
  );
}

export default NewExpensesItem;
